import Profile from './about/Profile'
import Skills from './about/Skills'
import { skillsData } from '../utility'

import {Container, Typography, Grid} from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  root: {
    marginTop: theme.spacing(10),
    marginBottom: theme.spacing(10)
  },
  component: {
    marginTop: theme.spacing(5)
  }
}))

function About() {
  const classes = useStyles()

  return (
    <Container maxWidth="md" justify="center" className={classes.root}>
      <Typography variant="h4" align= "center" style={{fontWeight: "800", textDecoration: "underline"}}>ABOUT</Typography>

      <Grid container justify="space-between" className={classes.component}>
        <Grid item xs={12} sm={5} >
          <Profile />
        </Grid>
        <Grid item xs={12} sm={7}>
          {skills.map(skills)}
          <Skills/>
        </Grid>
      </Grid>
    </Container>
  )
}

export default About
